import Vue from 'vue';
import Router from 'vue-router';

import checkreport from './views/CheckReportModule/CheckReportCode/CheckReport.vue'

Vue.use(Router);

var router = new Router({
  mode: 'hash',
  routes: [
    {
      path: "/checkreport",
      name: "checkreport",
      meta: { title: "检验单报表" },
      component: checkreport
    }
  ],
});;
router.beforeEach((to, from, next) => {
  /* 路由发生变化修改页面title */
  if (to.meta.title) {
    document.title = to.meta.title
  }
  next();
})

export default router
